import React from 'react';
import NewMessage from './NewMessage';
import classes from '../../../css/Dialogues/Message/Message.module.css';

const Message = (props) => {
    return (
        <div>
        <div className={`${classes.item} msg_${props.sendFrom}`}>
            {props.message}
        </div>
        <NewMessage />
        </div>
    );
}

export default Message;
